description:
Let the Wind Carry Me

Arts Documentary hosted by Tony Luo and Chiang Hsiu Chiung and Kwan Pun Leung, published by Yonder Pictures in 2009 - Chinese narration


Information
------------------------------

Portrait of Taiwan-born cinematographer Mark Lee (Ping Bin Lee), following him over the course of three years in Taiwan, Hong Kong, Japan and Europe, and interviewing more than 20 associates and observers about his work over almost 30 years.

